class IPDetailsManager {
    ipInformation = null;
    async getIPDetails({ peerId }) {
        if (!this.ipInformation) {
            const response = await fetch(`https://location-service.dyte.io/?token=3c493932b0624c&peerId=${peerId}`, {
                method: 'POST',
            });
            this.ipInformation = await response.json();
        }
        return this.ipInformation;
    }
}
const ipDetails = new IPDetailsManager();
export default ipDetails;
